Photoshop CS5 Trickery &amp; FX

As a digital artist, you have the advantage of being able to combine all of the creative art forms using your medium--the computer. Photoshop CS5 Trickery &amp; FX shows you how to take your creativity and your art to a new level by blending your traditional artistic skills and vision with the powerful tools of Adobe Photoshop CS5. Photoshop CS5 combines 2D, 3D, and video into one interface, and this latest version of the software includes significant improvements in the 3D tools and functionality. Each chapter in the book is laid out as a complete tutorial that shows you how to use the amazing new Photoshop CS5 features to transform ordinary photos into incredible special effects and digital creations. You'll also find projects that illustrate the more practical uses of Photoshop to help you master your photo editing skills. With the skills you learn, you'll be able to spend more time working on the creative side of your art than worrying about the challenges of the technical aspects of the medium. Photoshop CS5 Trickery &amp; FX shows you how to create fantastic digital art and imagery.  

